import { FunctionComponent ,useEffect} from "react";
import Navbar from "../components/navbar";


const SignUpPage: FunctionComponent = () => {
  // Add a useEffect hook to run code after component rendering
  useEffect(() => {
    // Select the signup button by its id
    const signupButton = document.getElementById("signupButton") as HTMLButtonElement;

    // Add an event listener to the button
    signupButton.addEventListener("click", () => {
      // Prevent multiple clicks by disabling the button
      signupButton.disabled = true;

      // Fetch input details
      const nameInput = document.getElementById("name") as HTMLInputElement;
      const emailInput = document.getElementById("email") as HTMLInputElement;
      const passwordInput = document.getElementById("pass") as HTMLInputElement;

      // Get input values using non-null assertion
      const name = nameInput.value!;
      const email = emailInput.value!;
      const password = passwordInput.value!;

      // Prepare the data to send to the server
      const data = {
        name,
        email,
        password,
      };

      // Make a POST request to your server to register the user
      fetch("http://localhost:3001/user/register", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(data),
      })
        .then((response) => {
          if (response.ok) {
            // Registration successful, handle accordingly
            alert("Registration successful!");
          } else {
            // Registration failed, handle accordingly
            alert("Registration failed. Please try again.");
          }

          // Re-enable the signup button
          signupButton.disabled = false;
        })
        .catch((error) => {
          console.error("Error:", error);

          // Re-enable the signup button
          signupButton.disabled = false;
        });
    });
  }, []);


  return (
    <div className="bg-white w-full h-[1024px] overflow-hidden text-left">
      <Navbar />
        {/* form div */}
        <div className="min-h-screen flex items-center justify-center bg-gray-100">
        <div className="w-2/4 h-3/4 bg-popup bg-gray-100 flex shadow-lg">
              <div className="">
              <b className="text-21xl inline-block text-black w-[181px] h-[49px]">
                SIGNUP
              </b>

              <input className="rounded-sm bg-white [backdrop-filter:blur(8px)] box-border w-[592px] h-[70px] border-[1px] border-solid border-silver text-9xl text-darkslategray-100 font-sora"
              type="password"
              id="pass"
              name="pass"
              placeholder="Enter tour Password">
              </input>
                <img
                  className=""
                  alt=""
                  src="/vector5.svg"
                />


              <input
                className="rounded-sm bg-white [backdrop-filter:blur(8px)] box-border w-[592px] h-[70px] border-[1px] border-solid border-silver text-9xl text-darkslategray-100 font-sora"
                type="email"
                id="email"
                name="name"
                placeholder="Enter your Email"
              />



              <input className="rounded-sm bg-white [backdrop-filter:blur(8px)] box-border w-[592px] h-[70px] border-[1px] border-solid border-silver text-9xl text-darkslategray-100 text-left font-sora"
              type="password"
              id="pass"
              name="pass"
              placeholder="Enter your Password">
              </input>

              <img
                className=""
                alt=""
                src="/vector5.svg"
              />


              <input className="rounded-sm bg-white [backdrop-filter:blur(8px)] box-border w-[592px] h-[70px] border-[1px] border-solid border-silver text-9xl text-darkslategray-100 font-sora"
              type="text"
              id="name"
              name="name"
              placeholder="Enter your Name">
              </input>

              <button className="rounded-11xl bg-darkslategray-100 w-[181px] h-[73px]"
                  id="signupButton"
                  style={{
                    textDecoration: "none", // Remove underline
                    color: "inherit",
                    cursor: "pointer", // Change cursor on hover
                  }}
                  >
                  <div className="text-white text-11xl font-sora">
                    Sign up
                  </div>
              </button>

              </div>
          </div>
          </div>
      </div>

  );
};



export default SignUpPage;
